import React from 'react'
import  {Link} from 'react-router-dom';
function Home() {
  return (
  <div>
    <>
      <h2>Home</h2>
      <Link to='/'><h1>home</h1></Link>
      <Link to='/about'><h1>About</h1></Link>
      <Link to='/contact'><h1>Contact</h1></Link>
    </>
  </div>
  )
}

export default Home
